import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";
import { FaCartPlus, FaUserPlus, FaBars } from "react-icons/fa";
import logo from "./image/logo.png";
import "./style.css";
class Navigator extends Component {
  render() {
    return (
      <div>
        <Navbar
          collapseOnSelect
          className="  "
          expand="lg"
          style={nav}
          variant="dark"
        >
          <Link to="/">
            {/* <Navbar.Brand href="#home" style={all} className="text-dark "> */}
            <Nav>
              <img
                className="image-responsive "
                style={img}
                src={logo}
                alt="Third slide"
              />
            </Nav>
            {/* </Navbar.Brand> */}
          </Link>
          <Navbar.Toggle
            aria-controls="responsive-navbar-nav"
            children={
              <h3>
                <FaBars />
              </h3>
            }
            style={col}
          />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto"></Nav>
            <Nav>
              <Nav.Link
                eventKey={2}
                href="/market"
                style={io}
                className="text-dark mt-4"
              >
                <b className="lin">
                  <h6>Market</h6>
                </b>
              </Nav.Link>
              <Nav.Link href="/cart" style={io} className="text-dark mt-4">
                <b className="lin">
                  <h6>Cart</h6> &nbsp;
                </b>
              </Nav.Link>
              <Nav.Link href="/checkout" style={io} className="text-dark mt-4">
                <b className="lin">
                  <h6>Checkout</h6> &nbsp;
                </b>
              </Nav.Link>
              <Nav.Link
                eventKey={2}
                href="/login"
                style={io}
                className="text-dark mt-4"
              >
                <b className="lin">
                  <h6>SignIn</h6> &nbsp;
                </b>
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

var io = {
  paddingLeft: "15px"
};

var col = {
  color: "black",
  fontSize: "12px",
  padding: "10px"
};

var nav = {
  backgroundColor: "#eef"
};
var img = {
  width: "190px"
  // marginBottom: "10px"
};
export default Navigator;
